    "northwest-montana-wetland-management-district-annual-narrative-report-calendar-year-1988",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Northwest
    Montana Wetland Management District outlines District accomplishments during the
    1988 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the management plan, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, croplands, grasslands, grazing, haying, pest control, and water rights.
    The wildlife section of the report endangered and threatened species, waterfowl,
    marsh and water birds, shorebirds, raptors, other migratory birds, game mammals,
    other resident wildlife, fisheries resources, and animal control. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    and equipment utilization and replacement. Cooperative programs are provided at
    the end. Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
